import React from "react";
import { PRODUCTS } from "../../products";
import { Product } from "./product";
import "./shop.css";

export const Shop = () => {
  return (
    <div className="shop">
        <div className="shopTitle">
            <h1>Adam's Shop</h1>
        </div>
        <div className="products">
            {PRODUCTS.map((product) => (
                <Product data={product} key={product.id}/>
            ))}
        </div>
    </div>
  );
};
